import React from 'react'
import './contact.css';

const Contact = () => {
  return (
    <section id='formpage'>
        <h3>CONTACT ME</h3>
        <p className='para'>Please fill out the form to contact me </p>
    <form className='form'>
        <input type='text'className='name' placeholder='YOUR NAME'></input>
        <input type='email'className='email' placeholder='YOUR EMAIL ID'></input>
        <input type='text'className='name' placeholder='YOUR MESSSAGE'></input>
    </form>
    </section>
  )
}

export default Contact
